import store from './store';
import React, {Component, Fragment} from 'react';
import { Link } from 'react-router-dom/cjs/react-router-dom.min';
class Home_Collapse extends Component{
    constructor(props){
        super(props);
        this.state = store.getState();
        this.handleStoreChange = this.handleStoreChange.bind(this);
        store.subscribe(this.handleStoreChange);
    }
    render(){
        const type_name = this.props.type_name;
        const items = this.state[type_name];
        return (
            <Fragment>
                {Object.keys(items).map((key)=>{
                    var data = { type : items, id: key};
                    data = JSON.stringify(data);
                    return (
                            <div key={key}>
                                <Link to={`/Detail/`}>
                                    <div>
                                        <div>{items[key].date}</div>
                                        <div>{items[key].ig_handle}</div>
                                    </div>
                                </Link>
                            </div>
                    )
                })}
            </Fragment>
        )
    }

    handleStoreChange(){
        this.setState(store.getState());
    }
}
export default Home_Collapse;
